import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './Home';
import About from './About';
import Contact from './Contact';
import Error from './Error';
// React Router version 6:

const App = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="*" element={<Error />} />
        </Routes>
      </BrowserRouter>
    </>
  );
};

export default App;

// Nested Route:

// Nested Route banane ke liye jo hamara main page hai (path="/") ye wala, iske self closing tag ko ham hata denge or iska closing tag end me aakar rak denge, ab is main Route ke ander jistne bhi Route honge bho nested route ban jaayenge.
